    false,nt"url": null,nt"notes": "This narrative report for Pablo National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1962. The report begins by summarizing the weather conditions, water conditions,
    habitat conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals,  furbearers, predators, rodents, raptors,
    fish, reptiles, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and vegetation control. Resource
    management is outlined; topics include grazing. The public relations section of
    the report describes recreational uses, hunting, and violations. N-R forms are attached.",nt"license_title":
